import React from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { AlertTriangle, CheckCircle2, Bell, Clock } from 'lucide-react';

const SensorAlerts = ({ sensors = [], onSelectSensor = () => {} }) => {
  const criticalSensors = sensors.filter(s => s.status === 'critical');
  const warningSensors = sensors.filter(s => s.status === 'warning');
  const normalSensors = sensors.filter(s => s.status === 'normal');

  const formatLastUpdate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleString('es-CL', { hour12: false });
  };

  return (
    <motion.div
      className="bg-white/80 backdrop-blur-xl border border-gray-200/50 rounded-3xl p-6 shadow-xl h-full overflow-y-auto"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6, delay: 0.4 }}
    >
      <h2 className="text-2xl font-bold text-gray-800 mb-6 flex items-center gap-3">
        <Bell className="w-7 h-7 text-orange-500" />
        Alertas Actuales (3 Total)
      </h2>

      {/* Solo crítico - Más prominente */}
      {criticalSensors.length > 0 && (
        <div className="mb-6 p-4 bg-red-50 border border-red-200 rounded-xl">
          <h3 className="text-xl font-semibold text-red-600 mb-3 flex items-center gap-2">
            <AlertTriangle className="w-5 h-5" />
            Crítica (1)
          </h3>
          <AnimatePresence>
            {criticalSensors.map((sensor) => (
              <motion.div
                key={sensor.id}
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                exit={{ opacity: 0, x: 20 }}
                transition={{ duration: 0.3 }}
                className="bg-red-100 border border-red-300 rounded-lg p-3 flex items-center justify-between cursor-pointer hover:bg-red-200 transition-colors"
                onClick={() => onSelectSensor(sensor)}
              >
                <div>
                  <p className="font-bold text-red-700 text-base">{sensor.name}</p>
                  <p className="text-red-500">Nivel: {sensor.value}%</p>
                  <p className="text-xs text-red-600 flex items-center gap-1">
                    <Clock className="w-3 h-3" />
                    {formatLastUpdate(sensor.lastUpdate)}
                  </p>
                </div>
                <AlertTriangle className="w-5 h-5 text-red-500" />
              </motion.div>
            ))}
          </AnimatePresence>
        </div>
      )}

      {/* Advertencia */}
      {warningSensors.length > 0 && (
        <div className="mb-6 p-4 bg-amber-50 border border-amber-200 rounded-xl">
          <h3 className="text-xl font-semibold text-amber-600 mb-3 flex items-center gap-2">
            <AlertTriangle className="w-5 h-5" />
            Advertencia (1)
          </h3>
          <AnimatePresence>
            {warningSensors.map((sensor) => (
              <motion.div
                key={sensor.id}
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                exit={{ opacity: 0, x: 20 }}
                transition={{ duration: 0.3 }}
                className="bg-amber-100 border border-amber-300 rounded-lg p-3 flex items-center justify-between cursor-pointer hover:bg-amber-200 transition-colors"
                onClick={() => onSelectSensor(sensor)}
              >
                <div>
                  <p className="font-bold text-amber-700 text-base">{sensor.name}</p>
                  <p className="text-amber-500">Nivel: {sensor.value}%</p>
                  <p className="text-xs text-amber-600 flex items-center gap-1">
                    <Clock className="w-3 h-3" />
                    {formatLastUpdate(sensor.lastUpdate)}
                  </p>
                </div>
                <AlertTriangle className="w-5 h-5 text-amber-500" />
              </motion.div>
            ))}
          </AnimatePresence>
        </div>
      )}

      {/* Normal */}
      {normalSensors.length > 0 && (
        <div className="p-4 bg-green-50 border border-green-200 rounded-xl">
          <h3 className="text-xl font-semibold text-green-600 mb-3 flex items-center gap-2">
            <CheckCircle2 className="w-5 h-5" />
            Normal (1)
          </h3>
          <AnimatePresence>
            {normalSensors.map((sensor) => (
              <motion.div
                key={sensor.id}
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                exit={{ opacity: 0, x: 20 }}
                transition={{ duration: 0.3 }}
                className="bg-green-100 border border-green-300 rounded-lg p-3 flex items-center justify-between cursor-pointer hover:bg-green-200 transition-colors"
                onClick={() => onSelectSensor(sensor)}
              >
                <div>
                  <p className="font-bold text-green-700 text-base">{sensor.name}</p>
                  <p className="text-green-500">Nivel: {sensor.value}%</p>
                  <p className="text-xs text-green-600 flex items-center gap-1">
                    <Clock className="w-3 h-3" />
                    {formatLastUpdate(sensor.lastUpdate)}
                  </p>
                </div>
                <CheckCircle2 className="w-5 h-5 text-green-500" />
              </motion.div>
            ))}
          </AnimatePresence>
        </div>
      )}
    </motion.div>
  );
};

export default SensorAlerts;
